import React from "react";
import { Modal , Button } from "react-bootstrap";


export default class confirmationPrompt extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      show: false,
    };
  }
  render() {
    return (
      <Modal.Dialog>
        <Modal.Header closeButton>
          <Modal.Title>Modal title</Modal.Title>
        </Modal.Header>

        <Modal.Body>
          <p>Modal body text goes here.</p>
        </Modal.Body>

        <Modal.Footer>
          <Button variant="Cancelar">Close</Button>
          <Button variant="Confirmar">Save changes</Button>
        </Modal.Footer>
      </Modal.Dialog>
    );
  }
}
